import { Component } from 'react'
import './index.css'

const viewConstent = {
    sedOtpView: 'SENDOTPVIEW',
    verifyOtpView: 'VERIFYOTPVIEW',
    loadingView: 'LOADING',
    successView: 'SUCCESS',
}

class CreateAccount extends Component {

    state = {
        createAccountView: viewConstent.sedOtpView
    }

    render() {
        return (
            <div className='create-account-bg'>
                <h1>create Account</h1>
            </div>
        )
    }
}

export default CreateAccount
